  false,\n\t\"url\": null,\n\t\"notes\": \"In situ, meteorological, navigational,
  physical and profile oceanographic data were collected, including AIR TEMPERATURE,
  BAROMETRIC PRESSURE, CONDUCTIVITY, CURRENT DIRECTION, CURRENT SPEED, CURRENT SPEED
  - EAST/WEST COMPONENT (U), CURRENT SPEED - NORTH/SOUTH COMPONENT (V), DEPTH - OBSERVATION,
  HYDROSTATIC PRESSURE, INCOMING SOLAR RADIATION, LATITUDE, LONGITUDE, PRECIPITATION
  RATE, RELATIVE HUMIDITY, SALINITY, SIGMA-THETA, WATER TEMPERATURE, WIND DIRECTION,
  WIND GUST and WIND SPEED from Moored Buoy at the NOAA Kuroshio Extension Observatory
  (KEO) using ADCP, GPS, anemometer, conductivity sensor, current meter, meteorological
  sensors, pressure sensors, pyranometer and thermistor from 2004-06-01 to 2015-09-07.
  These data were provided to one of the OceanSITES Data Assembly Centers (DAC). The
  DAC formatted this information into the OceanSITES file format and passed it on
  to the Global Data Assembly Centers (GDAC).nnOceanSITES is a worldwide system of
  long-term, open-ocean reference stations measuring dozens of variables and monitoring
  the full depth of the ocean from air-sea interactions down to the seafloor. It is
  a network of stations or observatories measuring many aspects of the ocean's surface
  and water column using, where possible, automated systems with advanced sensors
  and telecommunications systems, yielding high time resolution, often in real-time,
  while building a long record.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
